import React, { Component, useState } from 'react';
import './App.css';

const App = () => {
  const [value, setValue] = useState("some text");
  return (
    <div className="App">
      {value}
      <br/>
      <input value={value} onChange={(event) => {setValue(event.target.value)}}/>
      <label>some text</label>
      <input type="checkbox"/>
    </div>
  );
}

export default App;
